import {REGISTER, LOGIN} from "./actions";

const intialState = {
    userId: '',

};

export function Reducer( state = intialState, action){
    switch(action.type){
        case REGISTER:
            return {...state,userId:action.userId}



        default:
            return state

    }
    return state

}
